不知何時開始我們都習染了些奇怪習慣，
覺得別人對自己的生命應該負責任。
其中一樣就是快樂。

在某些節日，例如生日，情人節，週年紀念，等等…
期望別人要記得，為你送上祝福、蛋糕、禮物。
沒有發生預期之事情就不開心。
這個不開心該由誰來負責任呢？

先說生日吧。
生日最應該做的是要感謝父母，
沒有他們就沒有我們。
我不是只在生日這天才感恩父母的，
只是這天應該更加記住而已。
自我懂得後每年都會和媽媽特意吃個晚飯，
給她一個抱抱，好好感恩她多年的養育。
媽媽都會問我要不要生日蛋糕和禮物，
我都回應不需要了。
試過自己一個人過生日，
沒有覺得可憐，寧靜也是一種快樂。
忽然想吹吹蠟燭，
那就自己買了一個迷你蛋糕，
獨個兒在家做那些儀式，
獨個兒享受我那個迷你蛋糕，
我覺得很快樂。

快樂，
是應該自給自足的。
而不是靠別人提供。
別人給你做的，
永遠都是錦上添花之事，
發生時感恩就好，
感恩朋友珍惜大家的友誼，
感恩家人疼愛。

這圖片就是某年的獨個生日吃的小蛋糕，
還記得那天去選蛋糕時覺得很興奮，
花多撩亂，真的是花了點時間才挑到這個。
到現在也能記得吃蛋糕時那快樂感覺。

原來，我不是近年才懂得如何愛自己，
只是近年更加懂得，
感恩宇宙給我能力學懂了更多。

對我來說，
簡單就是快樂。

